(24, 14, '0', '<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&lsquo;সৎসঙ্গ পল্লীকল্যাণ সমিতি&rsquo; নামীয় সংস্থার বিবেচ্য পত্রখানা সদয় হয়ে দেখা যেতে পারে (পপৃঃ ১৮৪-২৫২)।</span></span><span style=\"font-family:NikoshBAN\"><span style=\"color:black\"> আবেদনে সংস্থার নিবন্ধন নবায়ন চাওয়া হয়েছে। </span></span><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">সংস্থার নিবন্ধন নং-৫৯৯, তারিখঃ ০৭/০৯/১৯৯২খ্রিঃ। সর্বশেষ নিবন্ধন/নবায়ন অনুযায়ী ০৬/০৩/২০১৭ খিঃ তারিখে নবায়নের মেয়াদ শেষ হয়েছে।</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">সংস্থা ব্যুরো নির্দেশনা মোতাবেক নিম্নেবর্ণিত কাগজপত্র দাখিল করেছে; যা সদয় দেখা যেতে পারেঃ</span></span></span><span style=\"font-size:12pt\">&nbsp;&nbsp; &nbsp; </span></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:18.85pt; vertical-align:top; width:27.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">ক্রঃ </span></span></span></p>\r\n			</td>\r\n			<td style=\"height:18.85pt; vertical-align:top; width:288.2pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">বিবরণঃ</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:18.85pt; vertical-align:top; width:22.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:18.85pt; vertical-align:top; width:81.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-fa