style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">:</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:top; width:81.05pt\"><a href=\"http://103.114.94.8:5002/admin/renewalFileDownload/last_ten_years/25\"><span style=\"color:#000000\"><span style=\"font-family:NikoshBAN\"><span style=\"font-size:16px\">পতাকা-&#39;১২&#39;</span></span></span></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:27.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">ঢ)</span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:288.2pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">সংস্থার বার্ষিক প্রতিবেদন</span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:22.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">:</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:top; width:81.05pt\"><a href=\"http://103.114.94.8:5002/admin/renewalFileDownload/last_ten_year_annual_report/25\"><span style=\"color:#000000\"><span style=\"font-family:NikoshBAN\"><span style=\"font-size:16px\">পতাকা-&#39;১৩&#39;</span></span></span></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:27.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">ণ)</span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:288.2pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">সর্বশেষ নবায়নের ফটোকপি</span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:22.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">:</span></span></span></p>\r\n			</td>\r\n			<td style=\"text-align:center; vertical-align:top; width:81.05pt\"><a href=\"http://103.114.94.8:5002/admin/renewalFileDownload/registration_or_renewal_certificate/25\"><span style=\"color:#000000\"><span style=\"font-family:NikoshBAN\"><span style=\"font-size:16px\">পতাকা-&#39;১৪&#39;</span></span></span></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:27.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">ত)</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:288.2pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">সমাজসেবা কার্যালয়ের সনদপত্রের কপি</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:22.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:13pt; text-align:center; vertical-align:top; width:81.05pt\"><span style=\"color:#000000\"><span style=\"font-family:NikoshBAN\"><span style=\"font-size:16px\">পতাকা-&#39;১৫&#39;</span></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:27.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">থ)</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:288.2pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">সমাজসেবা কার্যালয়ের অনুমোদিত নির্বাহী কমিটির তালিকা</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:22.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:13pt; text-align:center; vertical-align:top; width:81.05pt\"><a href=\"http://103.114.94.8:5002/admin/renewalFileDownload/laws_or_constitution/25\"><span style=\"color:#000000\"><span style=\"font-family:NikoshBAN\"><span style=\"font-size:16px\">পতাকা-&#39;১৬&#39;</span></span></span></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:27.05pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">দ)</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:288.2pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:12pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">বিগত ০৫(পাঁচ) বছরে বাস্তবায়িত প্রকল্পের তালিকা</span></span></span></p>\r\n			</td>\r\n			<td style=\"height:13.0pt; vertical-align:top; width:22.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n			</td>\r\n			<td style=\"height:13pt; text-align:center; vertical-align:top; width:81.05pt\"><span style=\"color:#000000\"><span style=\"font-family:NikoshBAN\"><span style=\"font-size:16px\">পতাকা-&#39;১৭&#39;</span></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align:justify\">সংস্থার দাখিলকৃত কাগজপত্র পর্যালোচনায়, সংস্থা কর্তৃক বিলম্বে নবায়নের আবেদন করা ও অন্যান্য কাগজপত্র ত্রুটি থাকায় তা সংশোধন করে দাখিল করার জন্য সংস্থাকে পত্র দেয়া হয়। সংস্থা সে মোতাবেক সংশোধিত কাগজপত্র ও বিলম্বে নবায়নের আবেদন করার কারণ ব্যাখ্যা করেছে; যা নিম্নে উপস্থাপন করা হলো।</p>\r\n\r\n<p style=\"text-align:justify\"><strong>&lsquo;সৎসংঘ পল্লীকল্যাণ সমিতি&rsquo;&nbsp;</strong>নামীয় সংস্থার নিবন্ধন নবায়ন এবং সংস্থা কর্তৃক বিলম্বে নবায়নের আবেদন করার বিষয়ে কারণ ব্যাখ্যা সংক্রান্ত পত্রখানা সদয় দেখা যেতে পারে (<a href=\"http://103.114.94.8:5002/admin/otherPdfView/8\">সংযুক্তি-&#39;ক&#39;</a>)। &nbsp;সংস্থার নিবন্ধন নং-৫৯৯, তারিখ: ০৭/০৩/১৯৯২খ্রিঃ। সর্বশেষ নিবন্ধন অনুযায়ী সংস্থাটির নিবন্ধনের মেয়াদ ০৬/০৩/২০১৭খ্রিঃ তারিখে শেষ হয়েছে। সংস্থা বিলম্বে নবায়নের আবেদনের বিষয়ে ব্যাখ্যা/জবাব দাখিল করেছে, যা সদয় দেখা যেতে পারে (<a href=\"http://103.114.94.8:5002/admin/otherPdfView/8\">সংযুক্তি-&#39;ক&#39;</a>)।&nbsp; সংস্থা&nbsp; জবাবে&nbsp;জানিয়েছে যে, সংস্থাটি নিবন্ধনের নিয়মিত কাজ যা দেশী বিভিন্ন সংস্থার সাথে পার্টনারশীপের মাধ্যমে বাস্তবায়ন করে আসছে। কিন্ত কোন বৈদেশিক দাতা সংস্থার প্রকল্পের অধীনে কোন অনুদান গ্রহণ করতে পারেনি বিধায় নিবন্ধন নবায়নের আবেদন করা হয়নি মর্মে পত্রে উল্লেখ করে সংস্থা আন্তরিকভাবে দুঃখ প্রকাশ করছে। বর্তমানে সংস্থা দাতা সংস্থার ০১টি প্রতিশ্রুতিপত্র পেয়েছে। সংস্থাটি নিবন্ধন নবায়ন করা হলে প্রকল্পটি বাস্তবায়ন করা সম্ভব হবে মর্মে উল্লেখ করে সংস্থার নিবন্ধন নবায়নের বিষয়টি বিবেচনার জন্য অনুরোধ জানিয়েছে।</p>\r\n\r\n<p style=\"text-align:justify\">&zwnj;তাছাড়া সংস্থা&nbsp;ব্যুরোর চেকলিষ্ট অনুযায়ী প্রয়োজনীয়&nbsp;তথ্যাদি ও কাগজপত্রাদি সংস্থা যথাযথভাবে দাখিল করেছে (পতাকা-০১-১৭)। সংস্থা ইতোপূর্বে নিবন্ধন নবায়নের জন্য নির্ধারিত ফি ও ভ্যাটসহ অন্যান্য কাগজপত্র দাখিল করেছে; যা পর্যালোচনায় যথাযথ আছে।</p>\r\n\r\n<p style=\"text-align:justify\">যেহেতু, সংস্থা দীর্ঘ কয়েক বছর যাবৎ নিবন্ধন নবায়নের আবেদন না করার জন্য ভুল স্বীকার ও আন্তরিকভাবে দুঃখ ও ক্ষমা প্রার্থনা করেছে এবং দাতা সংস্থার ৬,০০০ ইউরোর ০১ (এক) টি প্রকল্প ব্যুরোতে অনুমোদন ও অর্থছাড়ের জন্য দাখিল করেছে মর্মে জানিয়েছে। এ অবস্থায় সংস্থাকে উপরোক্ত কারণ দর্শানোর দায় হতে অব্যাহতি প্রদান করতঃ নিবন্ধন নবায়নের প্রক্রিয়া গ্রহণ করা যেতে পারে।</p>\r\n\r\n<p style=\"text-align:justify\">বর্ণিত অবস্থায় নিম্নেবর্ণিত ছকে সংস্থার বিগত ০৫(পাঁচ) বছর/নিবন্ধনের পর হতে বাস্তবায়িত প্রকল্পের তালিকাসহ মতামত এবং সংস্থার বিরুদ্ধে কোন অভিযোগ রয়েছে কিনা সে বিষয়ে মতামত প্রদানের জন্য এসাইনমেন্ট অফিসার-০৩&nbsp;এর শাখায় নথি প্রেরণ করা যেতে পারে।&nbsp;&nbsp;</p>\r\n\r\n<table align=\"left\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<hr />প্রকল্পের নাম ও মেয়াদ</td>\r\n			<td>প্রাক্কলিত ব্যয়</td>\r\n			<td>দাতা সংস্থার নাম</td>\r\n			<td>সংস্থার বিরুদ্ধে কোন অভিযোগ আছে কিনা? থাকলে তার বিবরণ</td>\r\n			<td>বাস্তবায়িত প্রকল্পের রিপোর্টসমূহ সংস্থা দাখিল করেছে কিনা?</td>\r\n			<td>মন্তব্য</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\">&nbsp; &nbsp;</p>', '18', '12', '18', '1', '1', NULL, 'অপরাহ্ন', 'অপরাহ্ন', '2024-01-29 23:49:21', '2024-01-31 06:00:18'),
(46, 14, '0', '<p><span style=\"font-size:14px\">উপরোক্ত নোট অনুচ্ছেদ সদয় দেখা যেতে পারে। উক্ত নোটের নির্দেশনা মোতাবেক &nbsp;প্রকল্প শাখার মতামত প্রদানের জন্য নথি প্রেরণ করা হলো।</span></p>', '18', '36', '35', '1', '1', NULL, 'অপরাহ্ন', 'অপরাহ্ন', '2024-02-10 19:53:03', '2024-02-10 20:30:18'),
(47, 14, '0', '<p style=\"text-align:justify\">উপরোক্ত নোটাঃ ১.২ সদয় দেখা যেতে পারে। উপরোক্ত নোটাঃ ১.২ এর প্রেক্ষিতে সদয় উল্লেখ করা যাচ্ছে, এনজিও&#39;টি সম্প্রতি অত্র শাখায় ০১টি প্রকল্প অনুমোদন ও অর্থছাড়ের জন্য অত্র শাখায় দাখিল করেছে; যা মন্ত্রণালয়ের মতামত গ্রহণ জন্য ২৮/১২/২০২৩ খ্রিঃ তারিখে ২টি মন্ত্রণালয়ে&nbsp;প্রেরণ করা হয়েছে। প্রকল্পটি&nbsp;&nbsp;অনুমোদন দেয়ার সময় হয়নি। সদয় প রবর্তী ব্যবস্থা গ্রহণের জন্য নথি সংশ্লিষ্ট সহকারী পরিচালক-১ এর শাখায় ফেরত পাঠানো যেতে পারে।</p>', '35', '12', '18', '1', '1', NULL, 'অপরাহ্ন', 'অপরাহ্ন', '2024-02-10 22:30:19', '2024-02-10 21:34:18'),
(48, 14, '0', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">বিষয়ঃ&nbsp;&nbsp; &nbsp;&lsquo;সৎসংঘ পল্লী কল্যাণ সমিতি&rsquo; নামীয় এনজিও&rsquo;র নিবন্ধন নবায়ন ও সনদপত্র স্বাক্ষর সংক্রান্ত।</span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">&lsquo;সৎসংঘ পল্লী কল্যাণ সমিতি&rsquo; নামীয় এনজিও&rsquo;র নিবন্ধন নবায়ন সংক্রান্ত নোটাঃ ১.১-১.৩ সদয় দেখা যেতে পারে। সংস্থার নিবন্ধন নং-৫৯৯, তারিখঃ ০৭/০৩/১৯৯২ খ্রিঃ। সর্বশেষ নিবন্ধন/নবায়ন অনুযায়ী সংস্থার নিবন্ধনের মেয়াদ ০৬/০৩/২০১৭ তারিখে শেষ হয়েছে।&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">সংস্থার নিবন্ধন নবায়ন সংক্রান্ত নোটাঃ ১.৩-এর প্রেক্ষিতে সংস্থার বিগত ০৫(পাঁচ) বছরে বৈদেশিক অনুদানে বাস্তবায়িত প্রকল্পের বিষয়ে মতামত গ্রহণের জন্য সংশ্লিষ্ট প্রকল্প শাখায় নথি প্রেরণ করা হয় (অনুঃ ১.২)। উক্ত নোটের প্রেক্ষিতে সংস্থা বিগত ০৫(পাঁচ) বৈদেশিক অনুদানে কোন প্রকল্প বাস্তবায়ন করেনি। তবে বর্তমানে ০১টি &nbsp;প্রকল্প অনুমোদন ও অর্থছাড়ের জন্য ব্যুরোতে দাখিল করেছে। প্রকল্পটির বিষয়ে মতামত গ্রহণের জন্য ০২টি মন্ত্রণালয়ে প্রেরণ করা হয়েছে মর্মে অনুঃ ১.৩ এ প্রকল্প শাখার মতামত প্রদান করা হয়েছে। &nbsp;তাছাড়া সংস্থার নিবন্ধন শাখার নথি পর্যালোচনায় দেখা যায়, সংস্থা নিবন্ধনের পর জানুয়ারি/২০০৮ হতে ডিসেম্বর/২০০৮ পর্যন্ত সময়ে ১১,০০,০০০/-(এগার লক্ষ) টাকার ০১টি প্রকল্প বাস্তবায়ন করেছে। যেহেতু, সংস্থা নিবন্ধনের পর বৈদেশিক অনুদানে ০১টি প্রকল্প বাস্তবায়ন করেছে এবং বর্তমানেও ০১টি প্রকল্প অনুমোদনের প্রক্রিয়াধীন রয়েছে; এ অবস্থায় ব্যুরোর প্রচলিত শর্তসাপেক্ষে সংস্থার নিবন্ধন নবায়নের বিষয়টি বিবেচনা করা যেতে পারে। সংস্থা নিবন্ধন নবায়নের জন্য নির্ধারিত ফি ও ভ্যাট প্রদান করেছে, যা নিম্নে উল্লেখ করা হলোঃ</span></p>\r\n\r\n<blockquote>\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">ক)&nbsp;&nbsp; &nbsp;নিবন্ধন নবায়ন ও গঠনতন্ত্র পরিবর্তন ফি &nbsp;&nbsp; &nbsp;:&nbsp;&nbsp; &nbsp;<a href=\"http://103.114.94.8:5002/admin/renewalFileDownload/registration_renewal_fee/25\">পতাকা-২</a><br />\r\nখ)&nbsp;&nbsp; &nbsp;নবায়ন ফি-এর উপর ১৫%ভ্যাট (বকেয়াসহ)&nbsp;&nbsp; &nbsp;:&nbsp;&nbsp; &nbsp;<a href=\"http://103.114.94.8:5002/admin/renewalFileDownload/registration_renewal_fee/25\">পতাকা-৩।</a></span></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">যেহেতু, সংস্থা নিবন্ধনের পর বৈদেশিক অনুদানে ০১টি প্রকল্প বাস্তবায়ন করেছে এবং বর্তমানেও ০১টি প্রকল্প অনুমোদনের জন্য প্রক্রিয়াধীন রয়েছে এবং সংস্থার বিরুদ্ধে কোন অভিযোগ নেই। সংস্থা সরকার নির্ধারিত ফি ও ভ্যাট সরকারী কোষাগারে জমা দিয়ে ব্যুরোতে নিবন্ধন নবায়নের জন্য আবেদন করেছে। সে ক্ষেত্রে ব্যুরোর প্রচলিত র্তসাপেক্ষে সংস্থার নিবন্ধন নবায়নের বিষয়টি বিবেচনা করা যেতে পারে। উল্লেখ্য, সংস্থা সকল বকেয়া ভ্যাট ও ফি দাখিল করেছে। ভ্যাট ও ফি অনলাইনে যাচাইয়ে যথাযথ আছে।&nbsp;</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">&zwnj;বর্ণিত অবস্থায় বিবেচিত হলে &ldquo;SATSANGA &nbsp;PALLIKALLYAN &nbsp;SAMITY&rdquo; নামীয় সংস্থার নিবন্ধন ০৭/০৩/২০১৭&nbsp;হতে ০৬/০৩/২০২৭ খ্রিঃ পর্যন্ত ১০ (দশ) বছর সময়ের জন্য প্রধানমন্ত্রীর কার্যালয় হতে ২৫ নভেম্বর ২০২১ তারিখে জারিকৃত পরিপত্রের ৪নং তফশীলে বর্ণিত শর্তসাপেক্ষে নবায়ন করা যেতে পারে। প্রস্তাব অনুমোদিত হলে পরবর্তীতে মুল নথিতে সনদপত্র মহাপরিচালক মহোদয়ের সদয় স্বাক্ষরের জন্য নথিতে উপস্থাপন করা যেতে পারে।</span></p>', '18', '2', '18', '1', '1', NULL, 'অপরাহ্ন', 'অপরাহ্ন', '2024-02-10 23:24:06', '2024-03-16 06:46:58');
