INSERT INTO `potrangsho_drafts` (`id`, `adminId`, `nothiId`, `sarokId`, `noteId`, `receiverId`, `SentStatus`, `status`, `office_subject`, `office_sutro`, `description`, `extra_text`, `sarok_number`, `created_at`, `updated_at`) VALUES
(5, 18, 12, 5, 20, NULL, 0, 'registration', '<p>...............................................</p>', '<p>(যদি থাকে):...............................................</p>', '<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Nikosh\">উপর্যুক্ত বিষয়ে</span><span style=\"font-family:Nikosh\"> তাঁর সংস্থার দাখিলকৃত কাগজপত্র পর্যালোচনায় দেখা যায়ঃ</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ক</span></span><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">)&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">২০১০-২০১১ অর্থবছর হতে হালনাগাদ পর্যন্ত সংস্থার নিবন্ধন/নবায়ন/নাম পরিবর্তন/গঠনতন্ত্র পরিবর্তন ফি বাবদ দাখিলকৃত চালানের উপর ১৫% বকেয়া ভ্যাট প্রদানপূর্বক চালানের মুলকপি দাখিল করা হয়নি;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; খ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; নির্বাহী কমিটির তালিকায় চেয়ারম্যান ও সেক্রেটারীর যৌথ স্বাক্ষর ও সীল প্রদান করা হয়নি</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">। </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">নির্বাহী কমিটিতে আত্মীয়তা রয়েছে, যা গ্রহণযোগ্য নয়। নির্বাহী কমিটির তালিকায় অধিকাংশ সদস্যদেরই নাম, জন্ম তারিখ, পিতার নাম, স্বামীর নাম ভোটার আইডি অনুযায়ী উল্লেখ করা হয়নি;</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\"> যা সংশোধনপূর্বক সংশ্লিষ্ট সকল কাগজপত্র দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">গ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; নির্বাহী কমিটি গঠন সংক্রান্ত কার্যবিবরণী যথাযথ হয়নি। নির্বাহী কমিটি গঠন/নির্বাচনের বিষয়ে গঠনতন্ত্রের ধারা অনুসরণপূর্বক নির্বাচন প্রক্রিয়ার সকল কাগজপত্র (নির্বাচন কমিশন নিয়োগ, নির্বাচন কমিশন কর্তৃক সিডিউল ঘোষনা, সিডিউল অনুযায়ী সকল কাগজপত্র, চুড়ান্ত ভোটার তালিকাসহ) দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ঘ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বিগত ০৫(পাঁচ) বছরের বার্ষিক রিপোর্ট দাখিল করা হয়নি। তাছাড়া আরও ০৩(তিন) বছরের অডিট রিপোর্ট দাখিল করা হয়নি; যা দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ঙ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">Right to </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">Information Act-2009</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\"> এর আওতায় </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">Focal Point </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">হিসেবে </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">নিয়োগপ্রাপ্ত ব্যক্তির নাম</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">, মোবাইল নম্বর/ফোন নম্বর এবং ইমেইল নম্বরসহ মহাপরিচালক বরাবরে দাখিল করে রিসিভ কপির ফটোকপি অত্রসাথে দাখিল করা প্রয়োজন</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; চ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; অডিট রিপোর্টের সত্যায়িত কপিসহ ফটোকপি সকল কাগজপত্র সত্যায়িত করে দাখিল করা প্রয়োজন; যা দাখিল করা হয়নি</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ছ</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\"><span style=\"color:black\">)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\">নিম্নোক্ত ছকে সংস্থার নিবন্ধনের/নবায়নের পর হতে হালনাগাদ পর্যন্ত বৈদেশিক অনুদানে বাস্তবায়িত কার্যক্রমের বিবরণী দাখিল করা প্রয়োজন (পৃথকভাবে)</span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:NikoshBAN\">: </span></span></span></span></p>\r\n\r\n<table border=\"1\" cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:solid windowtext 1.0pt; margin-left:.95in\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"vertical-align:top; width:29.1pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">ক্রঃ নং</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:49.45pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">সন [বিগত ০৫ (পাঁচ) বছরের]</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:49.5pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">প্রকল্পের নাম</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:34.9pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">মেয়াদ</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:35.65pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">কাজের প্রকৃতি</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:36.9pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">অর্থের পরিমান</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:42.75pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">ছাড়কৃত অর্থ</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:44.2pt\">\r\n			<p><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">গৃহিত বৈদেশিক অনুদান</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:23.4pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">ব্যয়</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:35.6pt\">\r\n			<p style=\"text-align:center\"><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">অবশিষ্ট</span></span></strong></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:28.95pt\">\r\n			<p><strong><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">মন্তব্য</span></span></strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:29.1pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">১</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:49.45pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">২</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:49.5pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৩</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:34.9pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৪</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:35.65pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৫</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:36.9pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৬</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:42.75pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৭</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:44.2pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৮</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:23.4pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">৯</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:35.6pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">১০</span></span></p>\r\n			</td>\r\n			<td style=\"height:8.05pt; vertical-align:top; width:28.95pt\">\r\n			<p style=\"text-align:center\"><span style=\"font-size:6.0pt\"><span style=\"font-family:NikoshBAN\">১1</span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Nikosh\">০২।&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বর্ণিত অবস্থায় উপরোক্ত তথ্যাদি/কাগজপত্র আগামী ১০(দশ) কর্মদিবসের মধ্যে ব্যুরোতে দাখিল করার জন্য অনুরোধ করা হলো।</span></span></span></p>', NULL, NULL, '2023-12-31 20:54:20', '2024-01-01 02:54:20'),
(6, 18, 12, 5, 20, NULL, 0, 'registration', '<p>...............................................</p>', '<p>(যদি থাকে):...............................................</p>', '<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Nikosh\">উপর্যুক্ত বিষয়ে</span><span style=\"font-family:Nikosh\"> তাঁর সংস্থার দাখিলকৃত কাগজপত্র পর্যালোচনায় দেখা যায়</span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ক</span></span><span style=\"font-family:Nikosh\"><span style=\"color:black\">)&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">২০১০-২০১১ অর্থবছর হতে হালনাগাদ পর্যন্ত সংস্থার নিবন্ধন/নবায়ন/নাম পরিবর্তন/গঠনতন্ত্র পরিবর্তন ফি বাবদ দাখিলকৃত চালানের উপর ১৫% বকেয়া ভ্যাট প্রদানপূর্বক চালানের মুলকপি দাখিল করা হয়নি;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">খ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; নির্বাহী কমিটির তালিকায় চেয়ারম্যান ও সেক্রেটারীর যৌথ স্বাক্ষর ও সীল প্রদান করা হয়নি</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">। </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">নির্বাহী কমিটিতে আত্মীয়তা রয়েছে, যা গ্রহণযোগ্য নয়। নির্বাহী কমিটির তালিকায় অধিকাংশ সদস্যদেরই নাম, জন্ম তারিখ, পিতার নাম, স্বামীর নাম ভোটার আইডি অনুযায়ী উল্লেখ করা হয়নি;</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\"> যা সংশোধনপূর্বক সংশ্লিষ্ট সকল কাগজপত্র দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">গ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; নির্বাহী কমিটি গঠন সংক্রান্ত কার্যবিবরণী যথাযথ হয়নি। নির্বাহী কমিটি গঠন/নির্বাচনের বিষয়ে গঠনতন্ত্রের ধারা অনুসরণপূর্বক নির্বাচন প্রক্রিয়ার সকল কাগজপত্র (নির্বাচন কমিশন নিয়োগ, নির্বাচন কমিশন কর্তৃক সিডিউল ঘোষনা, সিডিউল অনুযায়ী সকল কাগজপত্র, চুড়ান্ত ভোটার তালিকাসহ) দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ঘ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বিগত ০৫(পাঁচ) বছরের বার্ষিক রিপোর্ট দাখিল করা হয়নি। তাছাড়া আরও ০৩(তিন) বছরের অডিট রিপোর্ট দাখিল করা হয়নি; যা দাখিল করা প্রয়োজন</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ঙ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">Right to Information Act-2009</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\"> এর আওতায় </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">Focal Point </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">হিসেবে </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">নিয়োগপ্রাপ্ত ব্যক্তির নাম</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">, মোবাইল নম্বর/ফোন নম্বর এবং ইমেইল নম্বরসহ মহাপরিচালক বরাবরে দাখিল করে রিসিভ কপির ফটোকপি অত্রসাথে দাখিল করা প্রয়োজন</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">চ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; অডিট রিপোর্টের সত্যায়িত কপিসহ ফটোকপি সকল কাগজপত্র সত্যায়িত করে দাখিল করা প্রয়োজন; যা দাখিল করা হয়নি</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">&nbsp;ছ</span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\">নিম্নোক্ত ছকে সংস্থার নিবন্ধনের/নবায়নের পর হতে হালনাগাদ পর্যন্ত বৈদেশিক অনুদানে বাস্তবায়িত কার্যক্রমের বিবরণী দাখিল করা প্রয়োজন (পৃথকভাবে)</span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\">: </span></span></span></span></p>\r\n\r\n<table border=\"1\" cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse;