(7, 18, 12, 5, 20, NULL, 0, 'registration', '<p>...............................................</p>', '<p>(যদি থাকে):...............................................</p>', '<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ক)&nbsp; &nbsp;</span></span><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">২০১০-২০১১ অর্থবছর হতে হালনাগাদ পর্যন্ত সংস্থার নিবন্ধন/নবায়ন/নাম পরিবর্তন/গঠনতন্ত্র পরিবর্তন ফি বাবদ দাখিলকৃত চালানের উপর ১৫% বকেয়া ভ্যাট প্রদানপূর্বক চালানের মুলকপি দাখিল করা হয়নি;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">খ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;নির্বাহী কমিটির তালিকায় চেয়ারম্যান ও সেক্রেটারীর যৌথ স্বাক্ষর ও সীল প্রদান করা হয়নি। নির্বাহী কমিটিতে আত্মীয়তা রয়েছে, যা গ্রহণযোগ্য নয়। নির্বাহী কমিটির তালিকায় অধিকাংশ সদস্যদেরই নাম, জন্ম তারিখ, পিতার নাম, স্বামীর নাম ভোটার আইডি অনুযায়ী উল্লেখ করা হয়নি; যা সংশোধনপূর্বক সংশ্লিষ্ট সকল কাগজপত্র দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">গ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; নির্বাহী কমিটি গঠন সংক্রান্ত কার্যবিবরণী যথাযথ হয়নি। নির্বাহী কমিটি গঠন/নির্বাচনের বিষয়ে গঠনতন্ত্রের ধারা অনুসরণপূর্বক নির্বাচন প্রক্রিয়ার সকল কাগজপত্র (নির্বাচন কমিশন নিয়োগ, নির্বাচন কমিশন কর্তৃক সিডিউল ঘোষনা, সিডিউল অনুযায়ী সকল কাগজপত্র, চুড়ান্ত ভোটার তালিকাসহ) দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ঘ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বিগত ০৫(পাঁচ) বছরের বার্ষিক রিপোর্ট দাখিল করা হয়নি। তাছাড়া আরও ০৩(তিন) বছরের অডিট রিপোর্ট দাখিল করা হয়নি; যা দাখিল করা প্রয়োজন</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ঙ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Right to Information Act-2009 এর আওতায় Focal Point হিসেবে নিয়োগপ্রাপ্ত ব্যক্তির নাম, মোবাইল নম্বর/ফোন নম্বর এবং ইমেইল নম্বরসহ মহাপরিচালক বরাবরে দাখিল করে রিসিভ কপির ফটোকপি অত্রসাথে দাখিল করা প্রয়োজন;</span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">চ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; অডিট রিপোর্টের সত্যায়িত কপিসহ ফটোকপি সকল কাগজপত্র সত্যায়িত করে দাখিল করা প্রয়োজন; যা দাখিল করা হয়নি</span></span></span></span></span></p>', NULL, NULL, '2023-12-31 21:11:52', '2024-01-01 03:11:52'),
