><span style=\"color:black\">ঘ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; বিগত ০৫(পাঁচ) বছরের বার্ষিক রিপোর্ট দাখিল করা হয়নি। তাছাড়া আরও ০৩(তিন) বছরের অডিট রিপোর্ট দাখিল করা হয়নি; যা দাখিল করা প্রয়োজন</span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">ঙ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Right to Information Act-2009 এর আওতায় Focal Point হিসেবে নিয়োগপ্রাপ্ত ব্যক্তির নাম, মোবাইল নম্বর/ফোন নম্বর এবং ইমেইল নম্বরসহ মহাপরিচালক বরাবরে দাখিল করে রিসিভ কপির ফটোকপি অত্রসাথে দাখিল করা প্রয়োজন;</span></span></span></span></p>\r\n\r\n<p style=\"margin-left:22.5pt; margin-right:0in; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-size:11.0pt\"><span style=\"font-family:Nikosh\"><span style=\"color:black\">চ)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; অডিট রিপোর্টের সত্যায়িত কপিসহ ফটোকপি সকল কাগজপত্র সত্যায়িত করে দাখিল করা প্রয়োজন; যা দাখিল করা হয়নি</span></span></span></span></p>', NULL, NULL, '2023-12-31 21:26:06', '2024-01-01 03:26:06'),
