style=\"vertical-align:top; width:45.5pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,\"><span style=\"font-size:12.0pt\"><span style=\"font-family:NikoshBAN\">প্রাক্কলিত ব্যয়</span></span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:.8in\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,\"><span style=\"font-size:12.0pt\"><span style=\"font-family:NikoshBAN\">দাতা সংস্থার নাম</span></span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:87.3pt\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,\"><span style=\"font-family:NikoshBAN\">সংস্থার বিরুদ্ধে কোন অভিযোগ আছে কিনা</span><span style=\"font-family:NikoshBAN\">? থাকলে তাঁর বিবরণ।</span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:1.3in\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,\"><span style=\"font-size:12.0pt\"><span style=\"font-family:NikoshBAN\">বাস্তবায়িত প্রকল্পের রিপোর্টসমূহ সংস্থা দাখিল করেছে কিনা?</span></span></span></span></p>\r\n			</td>\r\n			<td style=\"vertical-align:top; width:.95in\">\r\n			<p style=\"margin-left:0in; margin-right:0in; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,\"><span style=\"font-size:12.0pt\"><span style=\"font-family:NikoshBAN\">মন্তব্য</span></span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in; text-align:center\">